String ip = remoteAddr;
if (ip != null && !ip.trim().equals("")) {
	try {
		String result = "";
		String[] ipList = ip.trim().split(",");
		for (int i = 0; i < ipList.length; i++) {
			String ipAddress = ipList[i];
			if (ipAddress != null && !ipAddress.trim().equals("")) {
				String country = ipInfo.getCountry(ipAddress);
				if (country != null) {
					result += country + ",";
				}
			}
		}
		if (result.endsWith(",")) {
			result = result.substring(0, result.length() - 1);
		}
		writeDirectly(htmlEncodeButNotSpace(result));
	} catch (final Exception e) {
		writeDirectly(htmlEncodeButNotSpace(ip));
	}
}

	writeDirectly(htmlEncodeButNotSpace(remoteAddr));
}
